import React, { Component } from 'react'

export default class RadioInput extends Component {
    render() {
        return (
            <div>
                <form>
                    <input type="radio" onChange={e=>this.props.handleChange(e)} name="inStock" value="In Stock"/>
                    <input type="radio" name="outOfStock" id="Out of Stock"/>
                </form>
            </div>
        )
    }
}
